import React from 'react'


class ChildComponent extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            childDetails : {
                name: "",
                age: "",
                address: ""
            }
        }
    }
    toSendDataToParent = () =>{
        this.setState({
            childDetails: {
                name: "Chandni",
                age: 100,
                address: "Shalimar Bagh"
            }
        })
    }
    render(){
        return (
            <div>
                <div>{this.props.fulldetails.name}</div>
                <div>{this.props.fulldetails.age}</div>
                <div>{this.props.fulldetails.address}</div>
                <div toSendDataToParent ={this.toSendDataToParent}></div>
            </div>
        )
    };
};

export default ChildComponent
